member.example:
This sample shows how to call OperationAsync with required parameters.

var client = new ParametersCadlClient();

var result = await client.OperationAsync(1234, 1234);

This sample shows how to call Operation with required parameters.

var client = new ParametersCadlClient();

var result = client.Operation(1234, 1234);

This sample shows how to call OperationAsync with required parameters and parse the result.

var client = new ParametersCadlClient();

Response response = await client.OperationAsync(1234, 1234, new RequestContext());

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.GetProperty("id").ToString());

This sample shows how to call Operation with required parameters and parse the result.

var client = new ParametersCadlClient();

Response response = client.Operation(1234, 1234, new RequestContext());

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
